import Form from "react-bootstrap/Form";
import MyButton from "./UI/MyButton";

function CreateForm(props) {
    return (
        <Form style={{ display: "flex" }}>
            <Form.Group
                style={{ display: "flex", width: " 300px", marginRight: "30px" }}
                className="mb-3"
                controlId="exampleForm.ControlInput1"
            >
                <Form.Label style={{ justifyContent: "center", marginRight: "15px" }}>
                    Name
                </Form.Label>
                <Form.Control
                    type="text"
                    placeholder="Name"
                    name="name"
                    value={props.name}
                    onChange={(e) => props.onChange(e.target)}
                />
            </Form.Group>
            <Form.Group
                style={{ display: "flex", width: " 300px", marginRight: "30px" }}
                className="mb-3"
                controlId="exampleForm.ControlTextarea1"
            >
                <Form.Label style={{ alignItems: "center", marginRight: "15px" }}>Value</Form.Label>
                <Form.Control
                    type="text"
                    name="text"
                    value={props.text}
                    onChange={(e) => props.onChange(e.target)}
                />
            </Form.Group>

            <MyButton style={{ width: "100%" }} onClick={props.onClick}>
                Create
            </MyButton>
        </Form>
    );
}

export default CreateForm;
